    @Override
    public void onUpgrade(SQLiteDatabase db, int oldVersion, int newVersion) {
        db.execSQL("DROP TABLE IF EXISTS " + TABLE_NAME);
        db.execSQL("DROP TABLE IF EXISTS " + TABLE_NAME2);
        onCreate(db);
    }

    public boolean insertData(String title, String place, String page, String nr, String lyrics, String chords ){
        SQLiteDatabase db = this.getWritableDatabase();
        ContentValues contentValues = new ContentValues();
        contentValues.put(COL_2, title);
        contentValues.put(COL_3, place);
        contentValues.put(COL_4, page);
        contentValues.put(COL_5, nr);
        contentValues.put(COL_6, lyrics);
        contentValues.put(COL_7, chords);
        long result = db.insert(TABLE_NAME, null, contentValues);
        if(result == -1) return false;
        else return true;
    }

    public Cursor viewData() {
        SQLiteDatabase db = this.getWritableDatabase();
        Cursor res = db.rawQuery("select * from " + TABLE_NAME, null);
        return res;
    }

    public Integer updateData(Integer id, String title, String place, String page, String nr, String lyrics, String chords) {
        SQLiteDatabase db = this.getWritableDatabase();
        String where = "ID="+id;
        ContentValues contentValues = new ContentValues();
        contentValues.put(COL_2, title);
        contentValues.put(COL_3, place);
        contentValues.put(COL_4, page);
        contentValues.put(COL_5, nr);
        contentValues.put(COL_6, lyrics);
        contentValues.put(COL_7, chords);
        return db.update(TABLE_NAME, contentValues, where, null);
    }

    public Integer deleteData(Integer id) {
        SQLiteDatabase db = this.getWritableDatabase();
        String where = "ID="+id;
        return db.delete(TABLE_NAME, where, null);
    }

    public ArrayList<Song> getData() {
        SQLiteDatabase db = this.getReadableDatabase();
        ArrayList<Song> songs= new ArrayList<Song>();
        Cursor result = db.rawQuery("select * from "+ TABLE_NAME , null);
        while(result.moveToNext()){
            songs.add( new Song(result.getString(result.getColumnIndex(COL_1)), result.getString(result.getColumnIndex(COL_2)),
                    result.getString(result.getColumnIndex(COL_3)),result.getString(result.getColumnIndex(COL_4)),
                    result.getString(result.getColumnIndex(COL_5)),result.getString(result.getColumnIndex(COL_6)),
                    result.getString(result.getColumnIndex(COL_7))));
        }
        return songs;
    }

    public Song getSong(Integer songId) {
        SQLiteDatabase db = this.getReadableDatabase();
        ArrayList<Song> songs= new ArrayList<Song>();
        Cursor result = db.rawQuery("select * from "+ TABLE_NAME + " where id like '" + songId + "'", null);
        while(result.moveToNext()){
            songs.add( new Song(result.getString(result.getColumnIndex(COL_1)), result.getString(result.getColumnIndex(COL_2)),
                    result.getString(result.getColumnIndex(COL_3)),result.getString(result.getColumnIndex(COL_4)),
                    result.getString(result.getColumnIndex(COL_5)),result.getString(result.getColumnIndex(COL_6)),
                    result.getString(result.getColumnIndex(COL_7))));
        }
        if(!songs.isEmpty()) return songs.get(0);
        else return null;
    }

    public ArrayList<Song> getFilteredData(String word, String songbook) {
        SQLiteDatabase db = this.getReadableDatabase();
        ArrayList<Song> product= new ArrayList<Song>();
        Cursor result;
        if(songbook.length()>0 && word.length()>0) {
            result = db.rawQuery("select * from " + TABLE_NAME + " where place like '" + songbook + "' and (title like '%" + word + "%' or lyrics like '%" + word + "%')", null);        }
        else if(word.length()>0) result = db.rawQuery("select * from " + TABLE_NAME + " where title like '%" + word + "%' or lyrics like '%" + word + "%'", null);
        else if(songbook.length()>0) result = db.rawQuery("select * from " + TABLE_NAME + " where place like '" + songbook + "'", null);
        else result = db.rawQuery("select * from " + TABLE_NAME, null);
        while(result.moveToNext()){
            product.add( new Song(result.getString(result.getColumnIndex(COL_1)), result.getString(result.getColumnIndex(COL_2)),
                    result.getString(result.getColumnIndex(COL_3)),result.getString(result.getColumnIndex(COL_4)),
                    result.getString(result.getColumnIndex(COL_5)),result.getString(result.getColumnIndex(COL_6)),
                    result.getString(result.getColumnIndex(COL_7))));
        }
        return product;
    }

    public boolean insertSongbook(String title){
        SQLiteDatabase db = this.getWritableDatabase();

        ContentValues values = new ContentValues();
        values.put(COL_9, title);
        long result = db.insert(TABLE_NAME2, null, values);
        db.close();
        if(result == -1) return false;
        else return true;
    }

    public Integer deleteSongbook(String title) {
        SQLiteDatabase db = this.getWritableDatabase();
        String where = "title='"+title+"'";
        String where2 = "place='"+title+"'";
        db.delete(TABLE_NAME, where2, null);
        return db.delete(TABLE_NAME2, where, null);
    }

    public List<String> getAllSongbooks(){
        List<String> songbooks = new ArrayList<>();

        String selectQuery = "SELECT * FROM " + TABLE_NAME2;

        SQLiteDatabase db = this.getReadableDatabase();
        Cursor cursor = db.rawQuery(selectQuery, null);

        if (cursor.moveToFirst()) {
            do {
                songbooks.add(cursor.getString(1));
            } while (cursor.moveToNext());
        }

        cursor.close();
        db.close();

        return songbooks;
    }
